import React, { Component } from 'react'

import Container from '@material-ui/core/Container';

import Box from '../Components/box';

import Grid from '@material-ui/core/Grid';

class Home extends Component {
    constructor() {
        super()
        this.routeProfile = this.routeProfile.bind(this);
        this.routeContact = this.routeContact.bind(this);
        this.routePortfolio = this.routePortfolio.bind(this);
    }
    routeProfile() {
        let path= '/profile';
        this.props.history.push(path);
    }

    routeContact() {
        let path= '/contact'
        this.props.history.push(path)
    }

    routePortfolio() {
        let path= '/portfolio'
        this.props.history.push(path);
    }
    render() {
        return (
            <Grid
            container
  spacing={3}
  direction="column"
  alignItems="center"
  justify="center"
  style={{ minHeight: '100vm' }}>
      <Grid item md={6}>
            <Container maxWidth="x"
                style={{
                    backgroundColor: 'gray'
                }}>
                <h1>Walker Floyd</h1>
                <Box
                        style={{
                            width: '100%',
                            textAlign: "center",
                            justifyContent: "center",
                        }}
                            onClick={this.routeProfile}
                        >Profile</Box>
                <Box 
                            style={{
                                width: '100%',
                                textAlign: "center",
                                justifyContent: "center",
                            }}
                            onClick={this.routeContact}
                        >Contact</Box>
                <Box 
                            style={{
                                width: '100%',
                                textAlign: "center",
                                justifyContent: "center",
                            }}
                            onClick={this.routePortfolio}
                >Portfolio</Box>
            </Container>
            </Grid>
  </Grid>
        )
    }
}

export default Home;
